import React, { Component, Fragment } from 'react';
import { Link } from "react-router-dom";

class Mynav extends Component{

    render (){
        return (
            <Fragment>
                <div>
                    <ul>
                        <li><Nav.Link as={Link} axact activeStyle={{color: 'green'}} to='/'>NewHome</Nav.Link></li>
                        <li><Nav.Link as={Link} axact activeStyle={{color: 'red'}} to='/NewAbout'>NewAbout</Nav.Link></li>
                        <li><Nav.Link as={Link} axact activeStyle={{color: 'black'}} to='/NewContact'>NewContact</Nav.Link></li>
                    </ul>
                </div>
            </Fragment>
        )
    }
}
export default Mynav;
